pragma solidity ^0.8.3;

import "./DFA.sol";
import "./Exchanger.sol";


contract Factory {
  //  struct ExchangerRequestInfo {
  //    address user;
  //    uint amountToGet;
  //    uint amountToGive;
  //  }
  //
  //  struct ExchangerRequestFullInfo {
  //    address user;
